description:
इलामको देउमाईमा अटो दुर्घटना हुँदा एक जनाको मृत्यु भएको छ ।

जितपुरबाट मङ्गलबारेतर्फ गइरहेको अटो देउमाई नगरपालिका&amp;ndash;३ &amp;nbsp;पानीटार चियाबारी नजिक आज बिहान दुर्घटना भएको हो ।&amp;nbsp;

जिल्ला प्रहरी कार्यालयका सूचना अधिकारी लक्ष्मी भण्डार

राष्ट्रिय स्वतन्त्र पार्टीका वरिष्ठ नेता बालेन्द्र शाह (बालेन) इलाम पुगेका छन् ।

इलाम - १ का रास्वपा उम्मेदवार विमल गदाल र &amp;nbsp;इलाम- २ का उम्मेदवार गोकुलबहादुर राईको प्रचारप्रसारका लागि उनी इलाम पुगेका हुन् ।&amp;nbsp;

उनले इलामका विभिन्न क्ष

राष्ट्रिय परीक्षा बोर्डले यस वर्षको कक्षा १० को अन्तिम परीक्षा अर्थात् माध्यमिक शिक्षा परीक्षा (एसईई) चैत १९ गतेदेखि २९ गतेसम्म देशभर एकैसाथ सञ्चालन गर्ने भएको छ ।
&amp;nbsp;&amp;nbsp; &amp;nbsp;
बोर्डले आज एसईई परीक्षाको तालिका सार्वजनिक गर्दै आउँदो
